// DISPLAY USERS

import React, { useState, useEffect } from "react";
import Parse from "parse";
import Parsemin from "parse/dist/parse.min.js";
import { Link } from "react-router-dom";
import ChatSetup from "../../api/ChatSetup";

export default function DisplayUsers(props) {
  const [localUsers, setLocalUsers] = useState([]);

  useEffect(() => {
    queryAllUsers().then((result) => setLocalUsers(result));
  }, []);

  async function queryAllUsers() {
    try {
      console.log(props.currentUser);
      const queryUsers = new Parse.Query("User");
      queryUsers.notEqualTo("objectId", props.currentUser.id);
      const allUserObjects = await queryUsers.find();
      return allUserObjects;
    } catch (error) {
      console.log(error);
    }
  }
  console.log("localUsers: ", localUsers);

  const usersToDisplay = localUsers.map(
    (user, i) =>
      (user = (
        <li>
          <Link to="/chatroom" onClick={props.setSelectedUser(user)}>
            {" "}
            {user.get("username")}
          </Link>
          {/* <ChatSetup
            key={"index" + i}
            userObject={user}
            setSelectedUser={props.setSelectedUser}
          /> */}
        </li>
      ))
  );

  return <ul>{usersToDisplay}</ul>;
}
